INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", -363.0, 7, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 7001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", -363.0, 7, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 7002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", -363.0, 7, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 7003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", -363.0, 10, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 10001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", -363.0, 10, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 10002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", -363.0, 10, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 10003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", -363.0, 10, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 10004, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", -416.5, 12, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 12001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", -363.0, 13, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 13001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", -363.0, 13, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 13002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", -363.0, 13, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 13003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", -363.0, 13, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 13004, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", -363.0, 14, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 14001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", -363.0, 14, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 14002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", -363.0, 14, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 14003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", -363.0, 14, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 14004, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", -470.0, 15, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 15001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", -363.0, 16, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 16001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", -363.0, 16, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 16002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", -363.0, 16, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 16003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", -363.0, 16, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 16004, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", -363.0, 17, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 17002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", -363.0, 25, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 17004, 1);
