INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", -363.0, 25, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 17006, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", -363.0, 25, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 17007, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2030/12/17 14:59:59", -363.0, 18, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 18001, 1);
