INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2030/12/17 14:59:59", -470.0, 19, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 19002, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2030/12/17 14:59:59", -470.0, 20, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 20001, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2030/12/17 14:59:59", -470.0, 20, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 20002, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", -363.0, 21, 0.0, 106001, "2015/12/17 15:00:00", 0, 1, "キャル", 21001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2030/12/17 14:59:59", -363.0, 21, 0.0, 105901, "2015/12/17 15:00:00", 0, 1, "コッコロ", 21002, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", -363.0, 21, 0.0, 106401, "2015/12/17 15:00:00", 2104010, 2, "シェフィ", 21003, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", -363.0, 21, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 21004, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", -430.0, 22, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 22001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", -430.0, 22, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 22002, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", -430.0, 23, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 23001, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", -430.0, 23, 0.0, 190801, "2015/12/17 15:00:00", 0, 1, "カリン", 23002, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109001, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109001, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24002, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109001, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24003, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109001, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24004, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109001, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24005, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109002, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24006, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109002, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24007, 7);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109002, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24008, 8);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109002, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24009, 9);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109002, "2019/01/31 12:00:00", 0, 1, "エリコ（バレンタイン）", 24010, 10);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109101, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24011, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109101, "2019/01/31 12:00:00", 0, 5, "シズル（バレンタイン）", 24012, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, 10011, 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109101, "2019/01/31 12:00:00", 0, 2, "シズル（バレンタイン）", 24013, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109102, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24014, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109101, "2019/01/31 12:00:00", 0, 5, "シズル（バレンタイン）", 24015, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109102, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24016, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 10011, 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", -385.0, 24, 8.0, 109101, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24017, 7);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109102, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24018, 8);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109102, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24019, 9);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10011, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 0.0, 24, 0.0, 109102, "2019/01/31 12:00:00", 0, 1, "シズル（バレンタイン）", 24020, 10);
