INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", -363.0, 26, 0.0, 105801, "2015/12/17 15:00:00", 0, 1, "ペコリーヌ", 26002, 1);
