INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2030/12/17 14:59:59", -416.5, 44, 0.0, 123001, "2015/12/17 15:00:00", 0, 1, "アメス", 43005, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 0, 5.79, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2030/12/17 14:59:59", -416.5, 45, 0.0, 123001, "2015/12/17 15:00:00", 0, 1, "アメス", 43006, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0, 0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2030/12/17 14:59:59", -371.5, 46, 0.0, 123001, "2015/12/17 15:00:00", 0, 1, "アメス", 46001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 0, 0.0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "2030/12/17 14:59:59", -416.5, 47, 0.0, 104901, "2015/12/17 15:00:00", 0, 2, "シズル", 47001, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 0, 9.32, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", "2030/12/17 14:59:59", -416.5, 47, 0.0, 101101, "2015/12/17 15:00:00", 0, 1, "リノ", 47002, 1);
